const createTables = `
CREATE TABLE daily_summary (
  Type varchar(80),
  Symbol varchar(80) NOT NULL,
  Country varchar(80) NOT NULL,
  TradingDate varchar(80) NOT NULL,
  Open float ,
  High float ,
  Low float ,
  Close float ,
  Volume float ,
  OpenInt varchar(80),
  PRIMARY KEY (Symbol,Country,TradingDate)
);

CREATE TABLE symbols (
  Symbol varchar(10) NOT NULL,
  Name varchar(1024),
  Sector varchar(1024),
  IPOYear int(11),
  PRIMARY KEY (Symbol)
);

CREATE TABLE join_result (
  Type varchar(80) ,
  Symbol varchar(80) NOT NULL,
  Country varchar(80) NOT NULL,
  TradingDate varchar(80)  NOT NULL,
  Open float ,
  High float ,
  Low float ,
  Close float ,
  Volume float ,
  OpenInt varchar(80) ,
  Name varchar(1024),
  Sector varchar(1024),
  IPOYear int(11),
  PRIMARY KEY (Symbol,Country,TradingDate)
);
`

const createIndexes = `
CREATE INDEX idx_country ON daily_summary (Country);
CREATE INDEX idx_ipoyear ON symbols (IPOYear);
CREATE INDEX idx_country ON join_result (Country);
`

